// frontend/src/components/FoodPage.js
import React from 'react';

const FoodPage = () => {
  return (
    <div className="container mt-5">
      <h1>Our Menu</h1>
      <p>List of available food items.</p>
    </div>
  );
};

export default FoodPage;
